import React, {Component} from 'react'
import {connect} from "react-redux";

import Layout from "../_layouts/default/Layout";
import {login, logout} from "../../actions/AuthActions";

class CompositionsPage extends Component {
    render() {
        const {userActions, userInfo} = this.props

        return (
            <Layout drawer user={{userInfo, userActions}}>
                <div>
                    <h1>Compositions</h1>
                </div>
            </Layout>
        )
    }
}

const mapStateToProps = (store) => {
    return {
        userInfo: store.user
    }
}

const mapDispatchToProps = (dispatch) => {
    return {
        userActions: {
            login: () => dispatch(login()),
            logout: () => dispatch(logout()),
        }
    }
}

export default connect(mapStateToProps, mapDispatchToProps)(CompositionsPage)
